import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
   color: darkred;
   font: 3px

`


const CardComponent = () => {
    return (
        <div Card-Container>
            <div Container>
                <Title>AMEL MACRIFF</Title>
                <p>FREAKS</p>
                <p>2020</p>
                <img src ="https://photos.lensculture.com/large/60a65f7d-7f02-4f7c-b241-bd30601bbd5b.jpg"/>

            </div>
           <div>
           <i class="fab fa-instagram"></i>
           <i class="fab fa-facebook-square"></i>
           </div>

        </div>
    )}




export default CardComponent;
